import React, { Component } from 'react'

class User extends Component {

  render() {
    return (
      <div>
        <ul>
          <li>Name:{this.props.name}  </li>
          <li>department: {this.props.department}  </li>
          <li> Salary: {this.props.salary}  </li>
        </ul>
      </div>
    )
  }
}



export default User;
